import React from 'react';
import Menu from './components/Menu';
import { BrowserRouter,Routes,Route } from 'react-router-dom'
export default function App() {
  return (
    <div>
      <BrowserRouter>
      <Routes>
        <Route path='/' element={Menu}>
          <Route path='/Proje'/>
        </Route>
      </Routes>

      </BrowserRouter>
    </div>
  )
}
